for (var i = 0; i < datumgeiler.length; i++) {
    datumgeiler[i].innerHTML = moment(datumgeiler[i].innerHTML, "YYYY-MM-DD").format("D.M.");
}

// optimaler verbrauch
var topgoal = gesamtvolumen / parseInt(moment().daysInMonth());

// Legende
var legendeo = (topgoal / 1024).toFixed(2).replace('.', ',');
$( "#legendeo" ).append( " (" + legendeo + " GB / Tag)" );

var legendee = (document.querySelectorAll("th[align=right]")[0].innerHTML.replace('.', '') / 1024).toFixed(2).replace('.', ',');
$( "#legendee" ).append( " (" + legendee + " GB)" );

var legendeg = (document.querySelectorAll("th[align=right]")[1].innerHTML.replace('.', '') / 1024).toFixed(2).replace('.', ',');
$( "#legendeg" ).append( " (" + legendeg + " GB)" );

// Monatssumme abreißen
$( ".thbg" ).detach();


// table-to-json (ohne spalte Summe)
var tabledata = $('#daten').tableToJSON({ignoreColumns:[3]});
tabledata.reverse();
// console.log(tabledata);

// Alle Tage schon anzeigen, auch wenn noch keine Daten vorhanden sind
var tagebleiben = moment().daysInMonth() - moment().format("D");
if (tagebleiben != 0) {
    var tage = parseInt(moment().format("D"))+1;
    var monat = parseInt(moment().format("M"));
    for (var i = 0; i < tagebleiben; i++) {
      var data = 
      { 
        "Tag": tage+"."+monat+".",
        "Empfangen": 0,
        "Gesendet": 0
      };    
    tabledata.push(data);
    tage++;
    }
}


// chart erstellen
new Morris.Bar({
  element: 'barchart',
  data: tabledata,
  xkey: 'Tag',
  ykeys: ['Gesendet', 'Empfangen'],
  labels: ['Gesendet', 'Empfangen'],
  stacked: true,
  hideHover: true,
  gridLineColor: '#dddddd',  
  barColors: ['#23378b', '#56af31'],
  //barRatio: 0.8,
  xLabelAngle: 45,
  goals: [topgoal],
  goalStrokeWidth: 2,
  goalLineColors: ['rgba(86,175,49,0.5)'],
  yLabelFormat: function (y) { return y.toString() + ' MB'; }  
});

